import './App.css';
import LeftPanel from './Components/LeftPanel/LeftPanel';
import RightPanel from './Components/RightPanel/RightPanel';
import MiddlePanel from './Components/MiddlePanel/MiddlePanel';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          <div className="col-2">
            <LeftPanel />
          </div>
          <div className="col-8">
            <MiddlePanel />
          </div>
          <div className="col-2">
            <RightPanel />
          </div>
        </div>
      </div>
    </div>
  );
}
export default App;
